from collections import Counter
from itertools import permutations

MORSE = {'.-': 'A','-..': 'D', '..-.' : 'F', '--.': 'G', '...-': 'V', '-..-': 'X'}

DUMMYADFGVX = {'AA': 'A', 'AD': 'B', 'AF': 'C',
               'AG': 'D', 'AV': 'E', 'AX': 'F',
               'DA': 'G', 'DD': 'H', 'DF': 'I',
               'DG': 'J', 'DV': 'K', 'DX': 'L',
               'FA': 'M', 'FD': 'N', 'FF': 'O',
               'FG': 'P', 'FV': 'Q', 'FX': 'R' ,
               'GA': 'S', 'GD': 'T', 'GF': 'U',
               'GG': 'V', 'GV': 'W', 'GX': 'X',
               'VA': 'Y', 'VD': 'Z', 'VF': '0',
               'VG': '1', 'VV': '2', 'VX': '3',
               'XA': '4', 'XD': '5', 'XF': '6',
               'XG': '7', 'XV': '8', 'XX': '9' }

def morseToText(morseText):
  splitText = morseText.split("/")
  answer = ""
  for morse in splitText:
    answer += MORSE[morse]
  return answer

"""
Calculate the expected column order and count for a text encoded using ADFGVX
For all numbers of columns up to maxCols, all possible column transpositions are undone.
"""
def getColumns(text, maxCols):
  #Attempt all numbers of columns up to and including maxCols
  for cols in range(1,maxCols+1):
    print(cols) #useful to see how far the function is during execution
    colOrder = range(0,cols) #ordered list of the columns
    #generate all possible column orders for cols columns
    colPermutations = permutations(colOrder)
    #count number of columns with "extra" character (== number of columns with bottom cell filled in if some had to be left blank)
    biggerColCount = len(text) % cols
    charsPerCol = int(len(text) / cols)
    #For every possible column order...
    for colPerm in colPermutations:
      biggerCols = []
      colMap = {}
      #Generate list of cols with "extra" char (always the left ones in the untransposed version)
      for i in range(biggerColCount):
        biggerCols.append(colPerm[i])
      index = 0
      #For every column
      for colNr in range(cols):
        #Grab the col (they are in order in the transposed version)
        #Take one extra character if it's a "bigger" column
        if colNr in biggerCols:
          thisCol = text[index:index+charsPerCol+1]
          index += charsPerCol+1
        else:
          thisCol = text[index:index+charsPerCol]
          index += charsPerCol
        colMap[colNr] = thisCol

      #Now convert the columns to an untransposed ciphertext
      ADFGVXText = ""
      #In the permuted order, pick one character from each column, repeat until text fully formed
      for index in range(len(text)):
        ADFGVXText += colMap[colPerm[index%cols]][int(index/cols)]
      #Generate dummy decoded text
      dummyPlain = ""
      index = 0
      while index < len(ADFGVXText):
        digram = ADFGVXText[index:index+2]
        dummyPlain += DUMMYADFGVX[digram]
        index += 2
      c = Counter(dummyPlain)     #get the frequencies (absolute)
      #get index of coincidence
      freqSum = 0
      for freq in c:
        freqSum += (c[freq] * (c[freq]-1))
      div = len(dummyPlain) * (len(dummyPlain)-1) / 36
      IC = freqSum/div
      if 2 > IC > 1.8:
        print(colPerm, " has IC ", IC)
        print(ADFGVXText)

"""
Do a frequency analysis on the given text based on ADFGVX digrams represend single letters.
"""
def ADFGCXFrequencyAnalysis(text):
    count = 0
    counter = {'AA': 0, 'AD': 0, 'AF': 0,
               'AG': 0, 'AV': 0, 'AX': 0,
               'DA': 0, 'DD': 0, 'DF': 0,
               'DG': 0, 'DV': 0, 'DX': 0,
               'FA': 0, 'FD': 0, 'FF': 0,
               'FG': 0, 'FV': 0, 'FX': 0,
               'GA': 0, 'GD': 0, 'GF': 0,
               'GG': 0, 'GV': 0, 'GX': 0,
               'VA': 0, 'VD': 0, 'VF': 0,
               'VG': 0, 'VV': 0, 'VX': 0,
               'XA': 0, 'XD': 0, 'XF': 0,
               'XG': 0, 'XV': 0, 'XX': 0 }
    while count < len(text):
        digram = text[count] + text[count+1]
        counter[digram]+=1
        count+=2

    # calculate the frequencies
    frequencies = {'AA': 0, 'AD': 0, 'AF': 0,
                   'AG': 0, 'AV': 0, 'AX': 0,
                   'DA': 0, 'DD': 0, 'DF': 0,
                   'DG': 0, 'DV': 0, 'DX': 0,
                   'FA': 0, 'FD': 0, 'FF': 0,
                   'FG': 0, 'FV': 0, 'FX': 0,
                   'GA': 0, 'GD': 0, 'GF': 0,
                   'GG': 0, 'GV': 0, 'GX': 0,
                   'VA': 0, 'VD': 0, 'VF': 0,
                   'VG': 0, 'VV': 0, 'VX': 0,
                   'XA': 0, 'XD': 0, 'XF': 0,
                   'XG': 0, 'XV': 0, 'XX': 0 }

    for count in counter:
    #    print (count)
        frequencies[count] = counter[count]/(len(text)/2)*100

    for d in sorted(counter.items(), key=lambda x:x[1], reverse=True):
        print(d)
    for d in sorted(frequencies.items(), key=lambda x:x[1], reverse=True):
        print(d)

